PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "auth_user"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "first_name" CHAR(128),
    "last_name" CHAR(128),
    "email" CHAR(512),
    "password" CHAR(512),
    "registration_key" CHAR(512),
    "reset_password_key" CHAR(512),
    "registration_id" CHAR(512)
, "username" CHAR(128), "nome" CHAR(512), "funcao" CHAR(512), "cel" CHAR(512), "entrada" DATE, "milga" DOUBLE, "ativo" CHAR(1), "aniversario" DATE, "foto" CHAR(512), "aulas" TEXT, "documento" CHAR(512), "obs" TEXT);
CREATE TABLE IF NOT EXISTS "auth_group"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "role" CHAR(512),
    "description" TEXT
);
CREATE TABLE IF NOT EXISTS "auth_membership"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "user_id" INTEGER REFERENCES "auth_user" ("id") ON DELETE CASCADE  ,
    "group_id" INTEGER REFERENCES "auth_group" ("id") ON DELETE CASCADE  
);
CREATE TABLE IF NOT EXISTS "auth_permission"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "group_id" INTEGER REFERENCES "auth_group" ("id") ON DELETE CASCADE  ,
    "name" CHAR(512),
    "table_name" CHAR(512),
    "record_id" INTEGER
);
CREATE TABLE IF NOT EXISTS "auth_event"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "time_stamp" TIMESTAMP,
    "client_ip" CHAR(512),
    "user_id" INTEGER REFERENCES "auth_user" ("id") ON DELETE CASCADE  ,
    "origin" CHAR(512),
    "description" TEXT
);
CREATE TABLE IF NOT EXISTS "auth_cas"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "user_id" INTEGER REFERENCES "auth_user" ("id") ON DELETE CASCADE  ,
    "created_on" TIMESTAMP,
    "service" CHAR(512),
    "ticket" CHAR(512),
    "renew" CHAR(1)
);
CREATE TABLE IF NOT EXISTS "pessoas"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "nome" CHAR(512),
    "funcao" CHAR(512),
    "cel" CHAR(512),
    "entrada" DATE,
    "milga" DOUBLE,
    "ativo" CHAR(1),
    "foto" CHAR(512),
    "documento" CHAR(512),
    "obs" TEXT
);
CREATE TABLE IF NOT EXISTS "pessoa"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "nome" CHAR(512),
    "funcao" CHAR(512),
    "cel" CHAR(512),
    "entrada" DATE,
    "milga" DOUBLE,
    "ativo" CHAR(1),
    "foto" CHAR(512),
    "documento" CHAR(512),
    "obs" TEXT
, "aulas" TEXT, "aniversario" DATE);
CREATE TABLE IF NOT EXISTS "aula"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "nome" CHAR(512),
    "horario" TIME,
    "obs" TEXT
, "cor" CHAR(512), "fim" TIME, "dias" CHAR(512));
CREATE TABLE IF NOT EXISTS "feriado"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "nome" CHAR(512),
    "data_feriado" DATE,
    "tipo" CHAR(512),
    "obs" CHAR(512)
, "periodos" TEXT);
CREATE TABLE IF NOT EXISTS "conteudo"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "tipo" CHAR(512),
    "lancado" TIMESTAMP,
    "titulo" CHAR(512),
    "texto" TEXT,
    "link" TEXT,
    "imagem" CHAR(512)
, "ativo" CHAR(1), "texto_escuro" CHAR(1), "alinhamento" CHAR(512), "thumbnail" CHAR(512), "resumo" TEXT, "nova_guia" CHAR(1), "tipo_imagem" CHAR(512), "redondo" CHAR(1), "icone" CHAR(512), "ordem" CHAR(512), "texto_botao" CHAR(512), "tela_principal" CHAR(1));
CREATE TABLE IF NOT EXISTS "presenca"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "pessoa" INTEGER REFERENCES "auth_user" ("id") ON DELETE CASCADE  ,
    "aula" INTEGER REFERENCES "aula" ("id") ON DELETE CASCADE  ,
    "dia" DATE,
    "horario" TIME
, "valor" DOUBLE, "doc_pago" INTEGER, "horario_fim" TIME, "geo_x" DOUBLE, "geo_y" DOUBLE, "geo_distancia" DOUBLE);
CREATE TABLE IF NOT EXISTS "media_video"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "lancado" TIMESTAMP,
    "titulo" CHAR(512),
    "resenha" TEXT,
    "link" TEXT,
    "imagem" CHAR(512),
    "tipo_media" CHAR(512),
    "idioma" CHAR(512),
    "legendas" CHAR(512),
    "duracao" CHAR(512)
, "arquivo" CHAR(512), "palestrante" INTEGER REFERENCES "palestrante" ("id") ON DELETE CASCADE, "categoria" INTEGER REFERENCES "categoria" ("id") ON DELETE CASCADE, "aprovacao" CHAR(512), "solicitar_legendas" CHAR(1), "legendas_entregues" TIMESTAMP, "tags" TEXT, "eh_top" CHAR(1), "ciclo" CHAR(512), "id_ref_media" CHAR(512), "minutes" INTEGER, "criado_por" INTEGER, "tag_chave" INTEGER REFERENCES "tag" ("id") ON DELETE CASCADE ON UPDATE CASCADE);
CREATE TABLE IF NOT EXISTS "palestrante"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "nome" CHAR(512),
    "celular" CHAR(512),
    "foto" CHAR(512)
, "bio" TEXT);
CREATE TABLE IF NOT EXISTS "categoria"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "nome" CHAR(512)
, "imagem" CHAR(512), "cor_fundo" CHAR(512), "fundo" CHAR(512));
CREATE TABLE IF NOT EXISTS "tag"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "nome" CHAR(512)
);
CREATE TABLE IF NOT EXISTS "legenda"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "lancado" TIMESTAMP,
    "media_video" INTEGER REFERENCES "media_video" ("id") ON DELETE CASCADE  ,
    "arquivo" CHAR(512),
    "lingua" CHAR(512),
    "obs" CHAR(512)
);
CREATE TABLE IF NOT EXISTS "provavel_user"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "user_ip" CHAR(512),
    "nome_user" CHAR(512),
    "criado_em" TIMESTAMP,
    "ultimo_coment_em" TIMESTAMP
);
CREATE TABLE IF NOT EXISTS "coment_media"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "media_id" INTEGER,
    "user_ip" CHAR(512),
    "nome_user" CHAR(512),
    "criado_em" TIMESTAMP,
    "comentario" TEXT
);
CREATE TABLE IF NOT EXISTS "vote_media"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "voter_ip" CHAR(512),
    "media_id" INTEGER,
    "vote_type" CHAR(512),
    "ativo" CHAR(1),
    "vote_time" TIMESTAMP,
    "user_id" INTEGER
);
CREATE TABLE IF NOT EXISTS "media_view"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "user_ip" CHAR(512),
    "media_id" INTEGER,
    "view_time" TIMESTAMP,
    "user_id" INTEGER
, "view_time_extension" INTEGER);
CREATE TABLE IF NOT EXISTS "media_tag"(
    "id" INTEGER PRIMARY KEY AUTOINCREMENT,
    "media_id" INTEGER,
    "tag_id" INTEGER,
    "ativo" CHAR(1)
);
DELETE FROM sqlite_sequence;
COMMIT;
