INSERT INTO media_video VALUES(3,'2023-12-21 14:37:10','Vayeshev - Qual problema de querer relaxar em paz? ',replace(replace('Vayeshev - Just wanna chill\r\nSobre o famoso rashi no início da parasha: \r\nבִּקֵּשׁ יַעֲקֹב לֵישֵׁב בְּשַׁלְוָה, קָפַץ עָלָיו רָגְזוֹ שֶׁל יוֹסֵף\r\n"Yaakov pediu pra sentar em paz, pulou sobre ele o aborrecimento de Yossef"\r\nO que quer dizer isso? Qual mal de sentar em paz?\r\nUma explicação ímpar do Rav Farhi!!! IMPERDÍVEL!!!','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/6ehDixCs7VOn1Kf7hNoupb?si=adAutPntQVKfNM8W7kgKiA','','S','i','n','15','Nenhuma imagem disponível',3,4,'A','F',NULL,'|8|1|','F',NULL,NULL,6,NULL,NULL);
