INSERT INTO media_video VALUES(5,'2024-01-03 14:47:28','Parashat Toldot – O Olam haze pertence a Yaacov?',replace(replace(' Se o acordo foi Esav ficar com Olam Haze e Yaacov Olam Haba, como podemos aproveitar? \r\nHistória da Torá misturado com chakirá misturado com uma mensagem para a vida. Isso é R Moshe Fried. ','\r',char(13)),'\n',char(10)),'https://www.aprendatorah.com.br/lesson/parashat-toldot-o-olam-haze-pertence-a-yaacov/','','L','p','n','35','Nenhuma imagem disponível',1,4,'A','F',NULL,'|1|','F',NULL,NULL,33,NULL,NULL);
INSERT INTO media_video VALUES(6,'2024-01-03 14:49:53','O Caminho para a Serenidade - Yom Kipur (em Hebraico)',replace(replace('Shiur imperdível!!!\r\n\r\nContra o yetzer hara comum de pensarmos "ou tudo ou nada"\r\n\r\nUma nova explicação pro final da última mishna de Yoma:\r\n\r\nאָמַר רַבִּי עֲקִיבָא, אַשְׁרֵיכֶם יִשְׂרָאֵל, לִפְנֵי מִי אַתֶּם מִטַּהֲרִין, וּמִי מְטַהֵר אֶתְכֶם, אֲבִיכֶם שֶׁבַּשָּׁמַיִם, שֶׁנֶּאֱמַר (יחזקאל לו), וְזָרַקְתִּי עֲלֵיכֶם מַיִם טְהוֹרִים וּטְהַרְתֶּם. וְאוֹמֵר (ירמיה יז), מִקְוֵה יִשְׂרָאֵל יְיָ, מַה מִּקְוֶה מְטַהֵר אֶת הַטְּמֵאִים, אַף הַקָּדוֹשׁ בָּרוּךְ הוּא מְטַהֵר אֶת יִשְׂרָאֵל\r\n\r\n\r\nMishna em inglês:\r\nhttps://www.sefaria.org/Mishnah_Yoma.8.9?lang=bi\r\n\r\n\r\nPq rabi akiva trouxe o passuk dos neviim e não da própria Torah, por exemplo "ki bayom haze yechaper aleichem... lifnei H'' titharu" \r\nTbm fala de H'' purificar am Israel?!?\r\n\r\n\r\nE a resposta é incrível, um maamar do rebe zt"l show!!! Ligando tbm com a famosa história de rabi akiva "água mole em pedra dura"!!! \r\n\r\nAsseret yemei teshuva bomba','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/0pON8ZLpxKyFUZdwaueLVk?si=Enp96oJ1T46DoxsV0z0PEA','','S','h','n','36','Nenhuma imagem disponível',2,5,'A','F',NULL,'|4|','T',NULL,NULL,38,NULL,NULL);
