INSERT INTO media_video VALUES(10,'2024-01-05 12:38:38','Excesso de auto-cobrança?',replace(replace('Galera : vídeo acima foi gravado pelo Dudu Katz 10 anos atrás \r\nEle me mandou faz um tempo e fez um grande impacto em mim \r\n\r\nHoje estava falando com um grande tzadik - cara faz mikve 6 vezes por dia e estava se cobrando que não faz 12 ( exemplo figurativo ) \r\nEsta época do ano / estas cobranças acontecem ... então me lembrei deste shiur do dudu \r\nPergunta é se nos cobramos por quereremos genuinamente fazer vontade de hashem (lishma de verdade )ou nos cobramos pelo nosso lado de gaavá/ de querer ser maior do que somos \r\n\r\nShiur revelador / mind changing','\r',char(13)),'\n',char(10)),NULL,'','A','p','n','36','media_video.arquivo.ba2654938eeebf9f.V2hhdHNBcHAgQXVkaW8gMjAyMy0xMi0yMSBhdCAwOS40Ny40Mi5tcDQ=.mp4',6,6,'A','F',NULL,'|4|','T',NULL,NULL,37,NULL,4);
