INSERT INTO media_video VALUES(15,'2024-01-09 20:45:25','Conceito das quatro linguagem da redenção',replace(replace('Um excelente shiur que nos explica o conceito das quatro linguagem da redenção.\r\nPosso não ser escravo, só que não necessariamente significa que sou livre...\r\nComo faço para ser livre! Depende de mim ou preciso de ajuda externa? \r\nComo sempre com várias histórias inspiradoras.','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/1QERHfjnM2MeyJ9SmePuEi?si=ZcA8h-vHQx-lu9TPYDagHA','','S','p','n','36','Nenhuma imagem disponível',8,4,'A','F',NULL,'|8|1|','T',NULL,NULL,52,NULL,NULL);
INSERT INTO media_video VALUES(16,'2024-01-10 02:06:51','Entrevista: Hadas Lowenstern - Marido faleceu lutando em Gaza ',replace(replace('Sem dúvida uma das entrevistas mais marcantes que já ouvimos ... beira o surreal \r\nVale o chizuk de emuná ! Saber que temos uma missão e tudo vem de Hashem \r\nSer herói não apenas na morte mas também em vida ..\r\nNão percam (literalmente) - lucidez da Hadassa é assustadora \r\n\r\nEntrevista incrível com a esposa de um soldado que faleceu na guerra. Eles tem 6 filhos, o mais velho de 12 anos e a menor com 10 meses.\r\nComo ela encara os desafios e as dificuldades nesse momento. E como temos pessoas especiais em Am Israel!','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/1aKcfsa86wkbnjUi0JPzlg?si=ZbzKGGC9SWC-DP27Ktw3Kg','','S','i','n','36','Nenhuma imagem disponível',17,6,'A','F',NULL,'|8|','T',NULL,NULL,58,NULL,NULL);
