INSERT INTO media_video VALUES(21,'2024-01-25 15:39:36','Beshalach - Por que Datan e Aviram, os grandes reshaim, foram salvos?',replace(replace('Na Parasha Beshalach um passuk chama atenção, existe um diálogo que o Faraó teve com Bnei Israel mesmo eles estando a quilômetros de distância ...Uma das explicações é que o Faraó estava tendo um diálogo com Datan e Aviram, dois personagens muito conhecidos por fazerem parte de muitos pecados e catástrofes dos yehudim antes da saída do Egito e durante o período do deserto.  Surge então a pergunta: se Datan e Aviran estavam com o Faraó naquele momento, como eles podem ter atravessado o mar? Rav Jacobson traz inúmeras fontes e provas para uma resposta simplesmente INCRIVEL que nos faz refletir sobre a importância de trabalhar sempre em prol da comunidade e da importância que temos que ter com o próximo.\r\nUm shiur para refletir e mudar nossas vidas!\r\nby Gabi Candi\r\n\r\nRecomendo  fortemente (Gabi ) ','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/2h8AYi914BPKwxurSQvYla?si=D95QSfXjRbKG7zjFgNYoJQ','','S','h','n','35','Nenhuma imagem disponível',2,4,'A','F',NULL,'|9|1|','F',NULL,NULL,34,NULL,21);
