INSERT INTO media_video VALUES(39,'2024-03-05 09:13:34','A força de nossa tefila',replace(replace('Rav Chaim de Brisk, em casos de pikuach nefesh permitia um yehudi mandar um telegrama (chilul shabat ) no shabat para um grande tzadik fazer tefila.... como eh possível ? Pikuach nefesh doche shabat, mas pedir para um tzadik rezar eh bem diferente de salvar uma vida !!\r\n\r\n\r\n-- Rav Ari conta a História do soldado wagshal , soldado religioso sequestrado pelos árabes assasinado no resgate dele e o hesped do pai dele sobre a força da tfila ! De arrepiar os cabelos \r\n\r\n-- As vezes nossas dificuldades ainda estao presentes justamente pela falta de tfila ! \r\n\r\nQuem passar por este shiur, vai chegar do outro lado entendendo de factum o que uma (várias ) tfila pode fazer... o real significado do poder da tefila','\r',char(13)),'\n',char(10)),'https://www.aprendatorah.com.br/lesson/a-forca-de-nossa-tefila/','','L','p','n','36','Nenhuma imagem disponível',20,6,'A','F',NULL,'|11|3|','F',NULL,NULL,37,NULL,3);
