INSERT INTO media_video VALUES(45,'2024-03-11 17:09:34','Raising Children: Equal Love For All',replace(replace('Hashem criou o homem com a capacidade de dar amor condicional para o filho, e amor incondicional para a filha. E criou dessa forma pois a filha recebe amor incondicional até a hora de casar, e depois consegue dar amor incondicional para o marido. Pai -> filha -> marido. Se o pai não dá esse amor incondicional, é da natureza da filha ir procurar isso em outro lugar. E isso é extremamente perigoso.\r\n\r\nConta sua experiência de mais de 40 anos em educação e como pode ver isso na prática. \r\n\r\nO que fazer quando um filho vem para um dos pais e diz: "Vou te contar uma coisa, com a condição que você não conte para a mãe/pai?". Análise dos dois lados desse dilema.\r\n\r\nUma aula com muita sabedoria sobre como educar e amar nossos filhos no mundo de hoje.','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/3t6KsHgeccSyUemTgfqJt1?si=YteKXBIiQsOBRno-QQxXhg','','S','i','n','35','Nenhuma imagem disponível',28,5,'A','F',NULL,'|12|','F',NULL,NULL,30,NULL,NULL);
