INSERT INTO media_video VALUES(49,'2024-03-14 21:01:26','Acredite nos teus sonhos !!',replace(replace('Chazon ish diz que ter emuna significa que as coisas ruins que teremos pelo caminho e as frustrações eh justamente porque hashem não precisa concordar com nossos sonhos… \r\n\r\nO leshem , maior kabalista do século 20 tem uma visão diferente e incriivel !!\r\n acredite nos seus sonhos tenha emuna em hashem eles vão acontecer - as frustrações são desafios para você não chegar lá !\r\n\r\nUma  visão inovadora incriivel e motivadora! \r\n\r\nAri bergman eh um mestre ! Além destes temas , aprendemos sobre papel do mishcan do beit hamikdash e do Aron !! \r\n\r\nShiur de emuna surreal\r\n\r\nLifechanging','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/2Isknrg8KhK6543s6MOKay?si=_dBoBDYOSeStgFUsKhfvGQ','','S','i','n','36','Nenhuma imagem disponível',31,6,'A','F',NULL,'|14|17|11|','T',NULL,NULL,50,NULL,NULL);
