INSERT INTO media_video VALUES(52,'2024-03-21 19:49:14','Purim Mordechai vs Haman',replace(replace('Porque em Purim temos que falar arur haman e baruch mordechai !! Em chanuca não falamos baruch hashmonaim, arurim ievanim !!! \r\n\r\nPorque a fantasia ?  \r\n\r\nQual a discussão real entre haman e mordechai? Desde quando começa esta briga milenar ? \r\n\r\nQuer entender purim de fato com profundidade ? Não perca este embate milenar que começa com essav e não com Haman . Haman só quer acertar as contas no que foi “tungado ” pelos yehudim ..: retomar o que era dele \r\n','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/7CT38XMbtugvzOemZSwiCe?si=45XXqs3VSYOJSKxpNEJuNA&context=spotify%3Ashow%3A4xCU9crgkNRsiGCJmhOuED','','S','i','n','36','Nenhuma imagem disponível',4,7,'A','F',NULL,'|26|11|','F',NULL,NULL,59,NULL,26);
INSERT INTO media_video VALUES(53,'2024-03-28 13:43:32','Simplicidade ',replace(replace('Shiur especial sobre manter a simplicidade mesmo após atingirmos o sucesso \r\n\r\nRav yedid diz que a maioria das pessoas que atinge o sucesso, muda, acha que passa a “merecer” ser digno de uma nova casta . Merece novos amigos \r\n\r\nPorque achashverosh foi parar em shushan, Um buraco no final do mundo ?! Shushan era o único lugar que sabiam fazer o trono replicando o trono do rei shlomo …\r\nPara satisfazer a este capricho, todo o reino mudou de cidade \r\n\r\nRav fala de quantas pessoas se tornam o Mr Lamborghini, Mr Chanel , Mr castelo com vista ao mar com direitos a framboesa importada, vista noroeste e brisa sul, e acha que de fato merecem este luxo, este novo patamar de vida , e todos em volta precisam entender a necessidade , importância , e idiossincrasia disso !!  Ele de fato se tornou  “especial” e merece ser diferente\r\n\r\nPoucos são aqueles , fala o rav, que cruzam a fronteira do sucesso , e se mantém com os mesmos valores e humildades de quando eram simples mortais\r\n\r\nA Palavra “Espetacular “ for criada para dar nome a este shiur !','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/3NZp3XuUSLLJ9FN0TdaDex?si=6U9T55mjSOK3XB75ZThLqw%0A','','S','i','n','36','Nenhuma imagem disponível',15,5,'A','F',NULL,'|4|8|22|11|27|15|','F',NULL,NULL,45,NULL,22);
