INSERT INTO media_video VALUES(70,'2024-05-03 12:21:20','Serve gratitude at your Passover Seder',replace(replace('Famosa música na hagada , dai dai daieinu, sobre cada item falamos que já teria sido suficiente agradecer - \r\nSaímos do Egito , daieinu, \r\nNão tivéssemos a tora , daieinu, tivéssemos a tora e não tivéssemos israel , daieinu \r\nSerá que eh verdade ? Sem tora seria suficiente , Sem israel seria suficiente ? Não parece ser verdade\r\n\r\nCharlie hararie em dez minutos nos conta uma lição de vida imperdível que aprendemos do excesso de daieinus \r\n\r\nDaí daí daieinu !!','\r',char(13)),'\n',char(10)),'https://youtu.be/jXO1RGxgc4M?si=zpEs9FHgI67fRxFv','','YT','i','p','15',NULL,5,7,'A','F',NULL,'|26|11|','F',NULL,NULL,11,NULL,26);
