INSERT INTO media_video VALUES(73,'2024-05-07 17:41:42','Entendendo a evolução da Torá Oral',replace(replace('R. Ari Bergman, um professor de UPenn, com passagem pela Yeshiva de Hevron, aborda um dos fundamentos da nossa Herança: o que é a Tora Oral? Como ela se desenvolve e se adapta ao tempo e espaço?\r\nO que define a ortodoxia judaica, mesmo que há dezenas de linhas ortodoxas no judaísmo?\r\n\r\nÉ fundamental, espetacular, dá pra ouvir no rápido, e vai mudar a vida de quem ouvir!\r\n\r\nOBS.: Shiur para público avançado, e tiver interesse real no assunto. Para estes, de grande benefício!','\r',char(13)),'\n',char(10)),'https://torahanytime.com/lectures/39395','','L','i','n','36','Nenhuma imagem disponível',31,5,'A','F',NULL,'|6|11|','F',NULL,NULL,38,NULL,NULL);
INSERT INTO media_video VALUES(74,'2024-05-16 19:20:09','Como ter suas Tefilot respondidas: Tem Alguém ouvindo?',replace(replace('omo funciona a Tefilá? Talvez a palavra “rezar” não seja a tradução correta para o que fazemos na sinagoga. O que significa Lehitpalel em hebraico, e o que podemos aprender disso para nossa tefilá e nossa vida? Muito diferente do que aprendemos na infância! \r\nSerá mesmo que o objetivo da tefilá é convencer Hashem de nos dar o que queremos?\r\nEsse shiur muda tudo!\r\n\r\nObs: 30 minutos de shiur e no final otimas perguntas e respostas sobre o assunto do shiur','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/16e6nMqWtDhUVo23q1PXG3?si=kmtyQgQ3Ss-Uw-Tcl7brvA','','S','i','n','35',NULL,34,6,'A','F',NULL,'|7|8|17|11|3|','F',NULL,NULL,30,NULL,3);
INSERT INTO media_video VALUES(75,'2024-05-23 14:43:55','Shabat',replace(replace('Shiur incrível e profundo sobre o verdadeiro significado do Shabat.\r\nPor que é uma das mitzvot mais importantes da torá? Por que precisa ter toda semana, diferente das outras datas judaicas? Rav Dr. Akiva Tatz nos dá uma nova visão para o shabat e o significado da vida!\r\nResponde a uma pergunta essencial que deve ser respondida \r\n\r\nPorque shabat tem a cada 7 dias e os chaguim apenas uma vez por ano ? Não tem excesso de shabat na nossa vida \r\nFalamos a resposta desta pergunta para um público não religioso e a turma pirou ! Vale para finalmente entender o shabat\r\nPúblico - avançado','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/2WHWQyPTiPnF6jgYK3agRl?si=_s1-JhLKTSq9Ye80R-gftQ','','S','i','n','36',NULL,23,5,'A','F',NULL,'|11|28|','F',NULL,NULL,53,NULL,28);
