INSERT INTO media_video VALUES(90,'2024-09-03 18:35:44','A recompensa',replace(replace('Carrasco alemão preso por assassinato de milhares de judeus teve dois netos judeus ! \r\nPerguntaram o que ele fez para merecer isso ','\r',char(13)),'\n',char(10)),NULL,'','V','i','p','5','media_video.arquivo.bca8dff3fc76d0d1.MDAwOTBfYV9yZWNvbXBlbnNhX2NhcnJhc2NvX3dhbGVyc3RlaW4ubXA0.mp4',28,3,'A','F',NULL,'|33|34|35|','F',NULL,NULL,5,NULL,33);
INSERT INTO media_video VALUES(91,'2024-09-03 18:41:09','The Miraculous Suvival of the Jewish People',replace(replace('R'' Daniel Glatstein  \r\nTorah To Brazil: Sao Paulo- The Miraculous Suvival of the Jewish People [Beit Yaakov]\r\n  \r\nTorahAnytime Links  \r\n📹 Video https://MyTaT.me/v318801  \r\n🎤 Audio https://MyTaT.me/a318801\r\n  \r\nRav Glatstein em sua visita ao Brasil da um shiur imperdível.. com diversas histórias de arrepiar ele responde a difícil pergunta “o que Hashem espera de mim, judeu que vive no Brasil em 2024?”','\r',char(13)),'\n',char(10)),'https://MyTaT.me/v318801','','L','i','n','5','Nenhuma imagem disponível',4,5,'A','F',NULL,'|13|','F',NULL,NULL,53,NULL,29);
INSERT INTO media_video VALUES(92,'2024-10-02 18:30:06','Segredo do Shofar de Rosh Hashana',replace(replace('Primeiros 5 minutos mais técnicos - cheio de perguntas \r\nMas quem se segurar os primeiros 5 minutos e entender as perguntas técnicas , vai ter acesso ao melhor presente de rosh hashana \r\n\r\nEste shiur eh literalmente um grande grande presente ! \r\nEm português \r\n\r\nQuer for nível avançado\r\nFaça-se um favor e escute este masterpiece !! \r\n\r\nShiur para chorar amanhã na hora do toque','\r',char(13)),'\n',char(10)),NULL,'','A','p','n','15','media_video.arquivo.8da0c6ba7e3b1ab5.Um9zaCBIYXNoYW5hIGUgU2hvZmFyIDU3ODUubXAz.mp3',31,7,'A','F',NULL,'|26|8|2|','F',NULL,NULL,13,NULL,NULL);
INSERT INTO media_video VALUES(93,'2024-10-10 14:32:22','Teshuva: O verdadeiro significado',replace(replace('Nossos sábios nos contam que yom kipur é um dos melhores dias do ano. Será que sentimos isso? Como devemos olhar para esse dia? O que realmente Hashem quer de nós?\r\n\r\nCharlie Harary conta a historia de um colega seu fazendo as pazes com a esposa, e mostra como podemos aprender daí para a nossa relação com Hashem no geral, e no Yom Kipur em especial!\r\n\r\nImperdível!','\r',char(13)),'\n',char(10)),'https://MyTAT.me/v67554','','L','i','n','36',NULL,5,7,'A','F',NULL,'|7|17|11|','F',NULL,NULL,47,NULL,11);
INSERT INTO media_video VALUES(94,'2024-10-10 14:34:50','Rosh Hashana: Se tornando a melhor pessoa possível',replace(replace('Porque o Shofar é tão importante para todos nos agora que Rosh Hashana se aproxima ?\r\n\r\nQual a relação que devemos ter com Hashem. Amor ou medo ? \r\n\r\nUm dos melhores videos  do ano  ! Imperdível para entrar em rosh hashana. \r\n\r\nCharlie Harari eh um advogado americano , um dos maiores palestrantes para o público judaico contemporâneo\r\n\r\nInglês. Legendas automáticas do youtube','\r',char(13)),'\n',char(10)),'https://youtu.be/3QQGxJe7Lls?si=Xv5Ne-zhFOXUiTKC','','YT','i','n','35','Nenhuma imagem disponível',5,7,'A','F',NULL,'|7|26|11|','F',NULL,NULL,26,NULL,26);
INSERT INTO media_video VALUES(95,'2024-10-10 14:36:52','Só da para fazer Teshuvá, se você se livrar da culpa',replace(replace('\r\nEm parashat Ki tavo falamos da mitzva de Vidui Maasser. Uma mitzvá interessante, na qual a pessoa “confessa” ter feito tudo certo, da melhor forma possível. \r\nQue tipo de confissão é essa!?\r\n\r\nRav YY nos traz uma lição de educação e auto estima importantíssima para que possamos fazer teshuvá e sermos melhores!\r\n\r\nCada um de nós precisa se sentir uma história de sucesso!\r\n\r\nLindo!','\r',char(13)),'\n',char(10)),'https://www.theyeshiva.net/jewish/item/5348/womens-ki-savo-rh-yk-class-you-can-only-do-teshuvah-if-you-get-rid-of-guilt','','L','i','n','36',NULL,2,5,'A','F',NULL,'|4|7|11|2|','F',NULL,NULL,60,NULL,2);
INSERT INTO media_video VALUES(96,'2024-10-10 14:39:13','Acendendo a alma de uma criança',replace(replace('Depois de anos estudando sobre o assunto, o Rav Kelemen ( formado em educação por Harvard ) criou um método de educação baseado na torá, que virou um livro best seller nos estados unidos (quadragésimo oitavo na lista Amazon ) . \r\nNeste shiur incriivel ele explica os 3 passos para a educação \r\nPlantar\r\nConstruir \r\nRezar \r\n\r\nAtravés de histórias incríveis ele comprova sua teoria baseada na tora e em mais de 400 estudos de harvard de educação de crianças \r\nEssencial para todos pais .\r\nEu como pai adorei!','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/277CBfxP3BssaDpvQIESIR?si=8mtzkzKTR1iAZ6FytxCx-g','','S','i','n','36','Nenhuma imagem disponível',43,5,'A','F',NULL,'|12|32|11|','F',NULL,NULL,60,NULL,12);
INSERT INTO media_video VALUES(97,'2024-10-10 14:45:30','Por que ser judeu?',replace(replace('Rav Dovid Orlofsky nos apresenta de forma divertida, uma pergunta que todos nós fazemos deveríamos fazer. Por que ser judeu? Será que eh um peso, um fardo?\r\nQual o objetivo da vida do yehudi? \r\n\r\nRav Dovid levanta a questão de varios pontos de vista muito interessantes e traz a sua resposta . Mas cada um está convidado a refletir e encontrar a sua.','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/7GQSpy8GMzs9rE7mFsuPSr?si=VOfxF8VXSJ-xYW-1aMQzEw','','S','i','n','36',NULL,44,5,'A','F',NULL,'|4|31|11|','F',NULL,NULL,50,NULL,4);
INSERT INTO media_video VALUES(98,'2024-12-03 20:00:25','Podcast com Ari Bergmann',replace(replace('R. Ari Bergman, brasileiro, estudou no Iavne quando criança (descobri no podcast) conta um pouco de sua historia, como parou em Israel, o que estudou… conta da sua proximidade com o Rav Shach e como isso influenciou num dos ataques do Tzahal ao Iraque!!\r\n\r\nMas esse não é o principal. O principal são os conselhos magicos que ele traz sobre como encarar o trabalho, riqueza… projetos precisam necessariamente de gente com muito recurso por tras ou gente com muita vontade e garra é mais essencial?\r\n\r\nSe não tivesse no podcast religioso certeza estaria muito difundido no mundo laico.\r\n\r\nHoje R Ari Bergman é um trader em bolsa americana, acadêmico, professor em universidade, e um talmid chacham (sábio em Torá) quase único','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/5z9A4QcLBJKAdfz6sNjtoG?si=SPOrsZx_R_-l0wIdTJn2VA&t=215&context=spotify%3Ashow%3A1qaVEt4KuHPLymc2MJnoaZ','','S','i','n','36',NULL,31,5,'A','F',NULL,'|4|13|11|','F',NULL,NULL,60,NULL,8);
INSERT INTO media_video VALUES(99,'2024-12-03 20:04:44','Por que uma vida de Torá?',replace(replace('Porque a Tora é tão especial? \r\nTer 613 mandamentos para cumprir ajuda ou atrapalha a nossa vida ? \r\nUm shiur que toca na ESSÊNCIA do que o é o judaísmo e o quão gostoso é ser yehudi. Mensagem forte e mais atual que nunca!','\r',char(13)),'\n',char(10)),' https://MyTAT.me/v323668','','L','i','n','36',NULL,45,6,'A','F',NULL,'|7|8|11|29|','F',NULL,NULL,56,NULL,7);
INSERT INTO media_video VALUES(100,'2024-12-03 20:07:00','Uma abordagem racional para a origem divina do Judaísmo',replace(replace('Um jovem judeu ateu, acadêmico, desenvolveu um algoritmo que mostra como cada religião não tem fundamento e não é real.. \r\n\r\nEle nunca pensou em aplicar ao judaísmo, já que essa ele tinha certeza que era uma piada… \r\naté que ele decidiu testar… e hoje ele é o renomado Rabino Lawrence Kelemen, autor de vários livros, palestrante mundialmente famoso!\r\n\r\nNesse shiur ele apresenta a teoria dele, e mostra o que fez mudar sua vida! \r\nRealmente incrível!','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/3GKAGzZ5lTbpzEhgOtexeF?si=pte7ERGjTLyEno08gJDVRw','','S','i','n','36',NULL,43,5,'A','F',NULL,'|17|11|','F',NULL,NULL,59,NULL,11);
INSERT INTO media_video VALUES(101,'2024-12-03 20:09:48','Charlene Aminoff','Podcast SURREAL! Uma lição de emuná e agradecimento a Hashem por tudo que temos. Uma mãe yehudia casada há muitos anos com vários históricos de aborto, cujos medicos mandaram ela simplesmente DESISTIR de ter filhos biológicos, começa uma jornada de fortalecimento de tsiniut e tem 5 filhos saudáveis! Porém a história da filha Galit é simplesmente uma das coisas mais absurdas que já ouvi na minha vida. Férias em Miami, sol, piscina e uma menina de 2 anos e meio sozinha com a babá que pegou no sono... daqui para frente deixo para vcs ouvirem o restante porque é muito difícil conseguir resumir o que a mãe conta sobre essa (quase) tragédia e as consequências que essa história gerou para várias outras mulheres judias ao redor do mundo. Simplesmente imperdível!','https://open.spotify.com/episode/4KdsetzpNEvqHDoPVIpcZW?si=_0JkSU9-TjiTKWskWgVQTg','','L','i','n','36',NULL,16,6,'A','F',NULL,'|25|30|21|11|','F',NULL,NULL,NULL,NULL,25);
INSERT INTO media_video VALUES(102,'2024-12-03 20:12:28','Sukkot - Na sombra da Emuná',replace(replace('Para entendermos a festa de Sukot, Rav Akiva Tatz fala sobre a relação de am israel com os outros povos.\r\nEle mostra, com várias fontes, como a suká tem uma ligação forte com essa relação, e qual é a visão do judaísmo para a humanidade como um todo. Será que somos um povo que só se importa com nós mesmos? O que desejamos para o resto do mundo, e como vamos chegar nisso?\r\nShiur super interessante!','\r',char(13)),'\n',char(10)),'https://open.spotify.com/episode/3wAC9TV0UQCSOQuOLRa64W?si=bYXGJWorRQy70crpPuqn8g','','L','i','n','36',NULL,23,7,'A','F',NULL,'|26|17|11|','F',NULL,NULL,50,NULL,26);
